import{_ as a,o as t,c as o,z as e,a as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 58.1-2814 Collection of unpaid bills for registration fees and franchise taxes by local treasurers.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-2814.md","filePath":"vacode/58.1-2814.md"}'),s={name:"vacode/58.1-2814.md"},n=e("h1",{id:"§-58-1-2814-collection-of-unpaid-bills-for-registration-fees-and-franchise-taxes-by-local-treasurers",tabindex:"-1"},[r("§ 58.1-2814 Collection of unpaid bills for registration fees and franchise taxes by local treasurers. "),e("a",{class:"header-anchor",href:"#§-58-1-2814-collection-of-unpaid-bills-for-registration-fees-and-franchise-taxes-by-local-treasurers","aria-label":'Permalink to "§ 58.1-2814 Collection of unpaid bills for registration fees and franchise taxes by local treasurers."'},"​")],-1),l=e("p",null,"The Comptroller may deliver a copy of any past-due bill for a registration fee or franchise tax, plus penalties and interest, to the treasurer of any county or city in which the corporation may have any property belonging to it and such copy of such bill shall have the force and effect of an execution in favor of the Commonwealth. The treasurer may distrain or levy upon and sell any real or personal property of such corporation and shall pay the amount of the bill into the state treasury within ten days after he has collected the same. The compensation of such treasurer for collecting and paying into the treasury such bill shall be five percent of the aggregate of the bill, which compensation shall be added to the bill by the treasurer, collected by him from such corporation and paid into the state treasury and then repaid to the treasurer on warrant of the Comptroller.",-1),i=e("p",null,"Code 1950, § 58-464; 1984, c. 675.",-1),c=[n,l,i];function h(d,f,p,u,y,b){return t(),o("div",null,c)}const g=a(s,[["render",h]]);export{_ as __pageData,g as default};
